id-file-permissions/" target="_blank">Technical details</a></p>'=>'<h3>Сајт се није могао увести</h3><p>Проверите да ли директоријум за складиштење <strong>%s</strong> поседује дозволе за упис и читање.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Технички детаљи</a></p>','<h3>Site could not be exported</h3><p>Please make sure that storage directory <strong>%s</strong> has read and write permissions.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Technical details</a></p>'=>'<h3>Сајт се није могао извести</h3><p>Проверите да ли директоријум за складиштење<strong>%s</strong> поседује дозволе за упис и читање.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Технички детаљи</a></p>','<h3>Site could not be restored</h3><p>Please make sure that storage directory <strong>%s</strong> has read and write permissions.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Technical details</a></p>'=>'<h3>Сајт се није могао повратити</h3><p>Проверите да ли директоријум за складиштење <strong>%s</strong> поседује дозволе за упис и читање.</p><p><a href="https://help.servmask.com/knowledgebase/invalid-file-permissions/" target="_blank">Технички детаљи</a></p>','All-in-One WP Migration: Your current profile role does not have Export/Import capabilities enabled. <a href="https://help.servmask.com/knowledgebase/how-to-add-import-and-export-capabilities-to-wordpress-users/" target="_blank">Technical details</a>'=>'All-in-One WP Migration: Ваш тренутни профил не поседује могућности за увоз/извоз <a href="https://help.servmask.com/knowledgebase/how-to-add-import-and-export-capabilities-to-wordpress-users/" target="_blank">Технички детаљи</a>','To choose a file please go inside the link and click on the browse button.'=>'Како бисте одабрали датотеку, молимо вас да унутар везе кликнете на дугме претраживача.','» <a class="ai1wm-no-underline" href="%s" target="_blank">Save permalinks structure</a>. (opens a new window)<br />» <a class="ai1wm-no-underline" href="https://wordpress.org/support/view/plugin-reviews/all-in-one-wp-migration?rate=5#postform" target="_blank">Optionally, review the plugin</a>. (opens a new window)'=>'» <a class="ai1wm-no-underline" href="%s" target="_blank">Сачувати структуру сталних веза</a>. (отвара нови прозор)<br />» <a class="ai1wm-no-underline" href="https://wordpress.org/support/view/plugin-reviews/all-in-one-wp-migration?rate=5#postform" target="_blank">Опционо, можете оставити рецензију за додатак</a>. (отвара нови прозор)','"Restore" functionality is available in a <a href="https://servmask.com/products/unlimited-extension" target="_blank">paid extension</a>.<br />You could also download the backup and then use "Import from file".'=>'Фунцкионалност "Повраћај" је доступна унутар <a href="https://servmask.com/products/unlimited-extension" target="_blank">плаћене екстензије</a>.<br />Можете такође преузети резервну копију и онда искористите опцију "Увези из датотеке".','Finish'=>'Завршетак','Click to set a label for this backup'=>'Кликните да поставите етикету за резервну копију','<a href="%s" class="ai1wm-button-green ai1wm-emphasize ai1wm-button-download" title="%s" download="%s"><span>Download %s</span><em>Size: %s</em></a>'=>'<a href="%s" class="ai1wm-button-green ai1wm-emphasize ai1wm-button-download" title="%s" download="%s"><span>Преузети%s</span><em>Величина: %s</em></a>','Unable to import: %s'=>'Немогућ увоз %s','Unable to import. Error code: %s. %s'=>'Немогућ увоз. Код грешке: %s. %s','The import process will overwrite your website including the database, media, plugins, and themes. Are you sure to proceed?'=>'Процес увоза ће преписати ваш веб сајт укључујући базу података, медију, додатке и теме. Да ли сте сигурни да желите наставити?','Unable to export: %s'=>'Немогуће извести: %s','Please make sure that your file was exported using <strong>All-in-One WP Migration</strong> plugin. <a href="https://help.servmask.com/knowledgebase/invalid-backup-file/" target="_blank">Technical details</a>'=>'Уверите се да је датотека извезена помоћу <strong>All-in-One WP Migration</strong> додатка. <a href="https://help.servmask.com/knowledgebase/invalid-backup-file/" target="_blank">Технички детаљи</a>','The archive file is corrupted. Follow <a href="https://help.servmask.com/knowledgebase/corrupted-archive/" target="_blank">this article</a> to resolve the problem.'=>'Архивска датотека је оштећена. Следите <a href="https://help.servmask.com/knowledgebase/corrupted-archive/" target="_blank">овај чланак</a> да бисте решили проблем.   ','Your PHP is 32-bit. In order to import your file, please change your PHP version to 64-bit and try again. <a href="https://help.servmask.com/knowledgebase/php-32bit/" target="_blank">Technical details</a>'=>'Ваш ПХП је 32-битни. Да бисте увезли датотеку, промените ПХП верзију у 64-битну и покушајте поново. <a href="https://help.servmask.com/knowledgebase/php-32bit/" target="_blank">Технички детаљи</a>','The import process will overwrite your website including the database, media, plugins, and themes. Please ensure that you have a backup of your data before proceeding to the next step.'=>'Процес увоза ће заменити вашу веб локацију, укључујући базу података, медије, додатке и теме. Уверите се да имате резервну копију података пре него што пређете на следећи корак.','<strong>%s</strong> is not the latest version. You must <a href="%s">update the plugin</a> before you can use it. <br />'=>'<strong>%s</strong> није најновија верзија. Морате да <a href="%s">ажурирате додатак</a> да бисте могли да га користите. <br />   ','WordPress Multisite is supported via our All-in-One WP Migration Multisite Extension. You can get a copy of it here'=>'Вордпрес мултисајт је подржан преко нашег All-in-One WP Migration мултисајт проширења. Копију можете добити овде','All-in-One WP Migration is not able to create <strong>%s</strong> folder. You will need to create this folder and grant it read/write/execute permissions (0777) for the All-in-One WP Migration plugin to function properly.'=>'All-in-One WP Migration не може да направи <strong>%s</strong> датотеку. Морате да направите ову фасциклу и доделите јој дозволе за читање / писање / извршавање (0777) како би All-in-One WP Migration додатак правилно функционисао. ','The file that you are trying to import is over the maximum upload file size limit of <strong>%s</strong>.<br />You can remove this restriction by purchasing our <a href="https://servmask.com/products/unlimited-extension" target="_blank">Unlimited Extension</a>.'=>'Датотека коју покушавате да увезете премашује дозвољену величину датотеке за отпремање од <strong>%s</strong>.<br />Ово ограничење можете уклонити куповином нашег <a href="https://servmask.com/products/unlimited-extension" target="_blank">неограниченог проширења</a>.  ','The file type that you have tried to upload is not compatible with this plugin. Please ensure that your file is a <strong>.wpress</strong> file that was created with the All-in-One WP migration plugin. <a href="https://help.servmask.com/knowledgebase/invalid-backup-file/" target="_blank">Technical details</a>'=>'Тип датотеке коју сте покушали да отпремите није компатибилан са овом додатком. Уверите се да је датотека <strong>.wpress</strong> датотека која је креирана помоћу All-in-One WP додатка за миграцију. <a href="https://help.servmask.com/knowledgebase/invalid-backup-file/" target="_blank">Технички детаљи</a>','All-in-One WP Migration is not able to create <strong>%s</strong> file. Try to change permissions of the parent folder or send us an email at <a href="mailto:support@servmask.com">support@servmask.com</a> for assistance.'=>'All-in-One WP Migration не може да направи <strong>%s</strong> датотеку. Покушајте да промените дозволе надређене фасцикле или нам пошаљите е-пошту на <a href="mailto:suppo